            temp = []
            for j in range(i):
                v = getbig(l[i], l[j], fs)
                if v > 1:
                    temp.append(v)
                    if flag:
                        x += 2 ** v - 2
                    else:
                        x -= 2 ** v - 2
            x += offset(temp, not flag)
        return x

    def getbig(v1, v2, factors):
        x = 1
        for f in factors:
            while v1 % f == 0 and v2 % f == 0:
                v1 //= f
                v2 //= f
                x *= f
        return x

